const Artists = () => {
  return (
    <section>
      <h2>Nos artistes</h2>

      <div className="artists-list">
        {artists.map((artist) => (
          <div className="artist-item" key={artist.id}>
            <h3>{artist.name}</h3>
            <h4>{artist.job}</h4>
          </div>
        ))}
      </div>
    </section>
  )
}

export default Artists
